import React from 'react';
import "./Banner.css";

export default class Banner extends React.Component {


	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="banerheight container-fluid">
				<div className="col-lg-12 col-md-12 col-xl-12 col-sm-12">
					<div className="col-lg-12 col-md-12 col-xl-12 col-sm-12 logoBox">
						<img className="logo img-responsive" src="./images/Logo.png" alt="logo"/>
						<img className="menuimg img-responsive pull-right" src="./images/3menubar.png" alt="logo"/>
					</div>
					<div className="col-lg-7 col-md-7 col-sm-7 col-7">
						<div className="pull-right mtop100">
							<span className="h1Title">MOBILITY
							</span><br/>
							<span className="h2Title">SOLUTIONS
							</span><br/>
							<span className="h3Title">We Build Robust & Scalable Mobile Applications
							</span>
						</div>	
					</div>
					<div className=" col-lg-5 col-md-5 col-sm-12 col-12 row">
						<img className="bannerImg img-responsive" src="./images/2.png" alt="Bannerpng"/>
					</div>
				</div>	


			</div>
		);
	}
}
